import React from 'react';
import '../css/Form.css';

function Form(){
    return (
        <div className='form'>
            <button className="buttonring" style={{color:'white'}}>LOG IN</button>
            <button className="buttonring" style={{color:'white'}}>SIGN UP</button>
            <h5>Shipping Information</h5>
            <form></form>
            <div className='row'>
               <input type="text" name="Email"> </input>
               <input type="text" name="Address"></input>
            </div>
            <div className='row'>

            </div>
        </div>
    )
}

export default Form;
